    this.cssSource = `<code class="language-css">
  .btn-ignite-vision {
    position: relative;
    padding: 80px;
    border-radius: 50%;
    background: #e2e6ea;
    border: none;
    cursor: pointer;
  }
  
  .btn-ignite-vision .text {
    width: 137px;
    height: auto;
    position: absolute;
    top: 50%;
    left: 50%;
    transform: translate(-50%, -50%) rotate(0deg);
    transform-origin: center;
    transition: transform 1.1s cubic-bezier(0.25, 1, 0.5, 1);
  }
  
  .btn-ignite-vision .arrow {
    width: 32px;
    position: absolute;
    top: 50%;
    left: 50%;
    transform: translate(-50%, -50%);
    transform-origin: center;
    transition: transform 1.1s cubic-bezier(0.25, 1, 0.5, 1);
  }
  
  .btn-ignite-vision:hover .text {
    transform: translate(-50%, -50%) rotate(-80deg);
    transition: transform 1.1s cubic-bezier(0.25, 1, 0.5, 1);
  }
  
  .btn-ignite-vision:hover .arrow {
    transform: translate(-50%, -50%) rotate(130deg);
    transition: transform 1.1s cubic-bezier(0.25, 1, 0.5, 1);
  }  
  </code>`;
